import { BodyCopy, body_copy_template } from '../component/blocks/bodyCopyBlock'

import {
	H1,
	heading_1_template,
	H2,
	heading_2_template
} from '../component/blocks/headingBlocks'
import { Image, image_template } from '../components/blocks/imageBlock'

export default function Blocks(props) {
	const data = props.data.index_blocks
	console.log(data)
	return (
		<>
			<H1 data={data[0]} />
			<BodyCopy data={data[1]} />
			<Image data={data[2]} />
		</>
	)
}

export const INDEX_PAGE_BLOCKS = {
	heading_1: {
		Component: H1,
		template: heading_1_template
	},
	heading_2: {
		Component: H2,
		template: heading_2_template
	},
	body_copy: {
		Component: BodyCopy,
		template: body_copy_template
	},
	image: {
		Component: Image,
		template: image_template
	}
}
